function eventoTipoActivoFijo(){$("#ClaseActivoFijo_IdTipoActivoFijo").on("change",function(o){partialViewTipoActivoFijo(o.val)})}function eventoRamo(){$("#Subramo_IdRamo").on("change",function(o){mostrarLoadingPanel("checkout-form","Cargando subramos..."),$.ajax({url:urlSubramoSelectResult,method:"POST",data:{idRamo:o.val},success:function(o){$("#div_subramo").html(o),Init_Select2()},complete:function(o){$("#checkout-form").waitMe("hide")}})})}function partialViewTipoActivoFijo(o){mostrarLoadingPanel("checkout-form","Cargando clases de activo fijo..."),$.ajax({url:claseActivoFijoSelectResult,method:"POST",data:{idTipoActivoFijo:null!=o?o:-1},success:function(o){$("#div_claseActivoFijo").html(o),Init_Select2()},complete:function(o){$("#checkout-form").waitMe("hide")}})}$(document).ready(function(){Init_Select2(),eventoTipoActivoFijo(),eventoRamo()});